@ExtendWith(MockitoExtension.class)
class PetTypeFormatterTest {

	@Mock
	private PetTypeRepository types;

	@InjectMocks
	private PetTypeFormatter controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns the pet type name when petType has a non-null name")
	void testPrintReturnsPetTypeName() {
		PetType petType = new PetType();
		petType.setName("Dog");
		var result = petType.print("petType", Locale.US);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns '<null>' when petType name is null")
	void testPrintReturnsNullWhenNameIsNull() {
		PetType petType = new PetType();
		petType.setName(null);
		var result = petType.print("petType", Locale.US);
		assertEquals("<null>", result);
	}

	@Test
	@DisplayName("Throws NullPointerException when petType is null")
	void testPrintThrowsNullPointerExceptionWhenPetTypeNull() {
		assertThrows(NullPointerException.class, () -> {
			instance.print(null, Locale.US);
		});
	}

	@Test
	@DisplayName("Returns pet type name regardless of locale provided")
	void testPrintWithDifferentLocale() {
		PetType petType = new PetType();
		petType.setName("Cat");
		var result = petType.print("petType", new Locale("fr", "FR"));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns the PetType object when the input text matches a PetType name in the collection")
	void testParseReturnsPetTypeWhenTextMatches() {
		PetType petType = new PetType();
		petType.setName("Dog");
		Collection<PetType> petTypes = List.of(petType);
		when(types.findPetTypes()).thenReturn(petTypes);
		var result = petType.parse("Dog", new Locale("en"));
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws ParseException when the input text does not match any PetType name")
	void testParseThrowsParseExceptionWhenTextNotFound() {
		PetType petType = new PetType();
		petType.setName("Bird");
		Collection<PetType> petTypes = List.of(petType);
		when(types.findPetTypes()).thenReturn(petTypes);
		assertThrows(ParseException.class, () -> {
			petType.parse("Cat", new Locale("en"));
		});
	}

	@Test
	@DisplayName("Throws ParseException when text is null and no PetType has a null name")
	void testParseThrowsParseExceptionWhenTextIsNull() {
		PetType petType = new PetType();
		petType.setName("Fish");
		Collection<PetType> petTypes = List.of(petType);
		when(types.findPetTypes()).thenReturn(petTypes);
		assertThrows(ParseException.class, () -> {
			petType.parse(null, new Locale("en"));
		});
	}

}
